import { mapGetters, mapMutations } from 'vuex'

export default {
  computed: {
    firstMenuMap() {
      return this.menuMap[this.moduleMenuIndex].children
    },
    ...mapGetters([
      'menuMap',
      'themeColor',
      'moduleMenuIndex',
      'firstMenuIndex'
    ])
  },
  methods: {
    clickFirstMenu(index) {
      this.setFirstMenuIndex(index)
    },
    ...mapMutations({
      'setFirstMenuIndex': 'SET_FIRST_MENU_INDEX'
    })
  }
}
